import React from 'react';
import TodoItem from './TodoItem';

function TodoList(props) {
  console.log(props)
  return (
    <div>
      {props.data.todos.map(data => {
        return <TodoItem key={data.id} item={data} />
      })}
    </div>
  )
}

export default TodoList;
